def cvt_geometry(geostr):

  w = h = xoff = yoff = 0
  if not geostr:
    return (w, h, xoff, yoff)
  off = geostr.split('+')
  dim = off[0].split('x')
  if len(dim) == 2:     # ['width', 'height']
    w = int(dim[0])
    h = int(dim[1])
  if len(off) == 3:     # ['', 'xoffset', 'yoffset']
    xoff = int(off[1])
    yoff = int(off[2])
  return (w, h, xoff, yoff)

