def gwh_to_twh(gwh):

    twh = gwh / 1000.0
    return twh

def move_direction(x, y, direction, amount):

    if direction == 'N':
        y += amount
    elif direction == 'E':
        x += amount
    elif direction == 'S':
        y -= amount
    else:
        x -= amount

    return x, y
